data.value:
Every Belgian person that is to be hired, has an electronic ID card. This id card stores relevant HR information:

- Surname
- your first two forenames and the first letter of your third forename;
- your place and date of birth;
- your sex;
- your nationality;
- the number of your identity card, consisting of twelve numbers;
- the start and end date of the period of validity of your identity card;
- your signature;
- your photo;
- address of the principal residence of the employee

By creating an add-on that would allow the HR administrator to read the data directly from the ID card and 
automatically create an employee, the administrative burden would be greatly reduced. The employee is 
created automatically in the system and the administrator only needs to complete the file.
